import React from "react";
import { Carousel, Image, Container } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

const Carrusel = () => {
  const images = [
    {
      id: 2,
      title: "Comienzos de integración a invernadero",
      src: "https://www.google.com/url?sa=i&url=https%3A%2F%2Fsuat.com.uy%2Fservicios_empresariales%2Fmedicina_empresarial%2F&psig=AOvVaw2rwbaYJQ8vhbTvz2Dbt7Zl&ust=1694159392321000&source=images&cd=vfe&opi=89978449&ved=0CBAQjRxqFwoTCID6kdmBmIEDFQAAAAAdAAAAABAE",
    },
    {
      id: 3,
      title: "Forma ejemplificada del invernadero",
      src: "assets/images/bg-about-us.jpg",
    },
  ];

  return (
    <Container>
      <Carousel>
        {images.map((image) => (
          <Carousel.Item key={image.id}>
            <Image src={image.src} alt={image.title} fluid />
            <Carousel.Caption>
              <h3>{image.title}</h3>
            </Carousel.Caption>
          </Carousel.Item>
        ))}
      </Carousel>
    </Container>
  );
};

export default Carrusel;
